import Canvas from './Canvas';
import { Link } from 'react-router-dom';
import logo from '../images/homepage/header8.png';
import info from '../images/homepage/info.png';
import redeem from '../images/homepage/redeem.png';


import { initializeApp } from "firebase/app";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyAOvGw6Zy6lnWQS6oraVZoFZx15Zgj4ICk",
  authDomain: "basquet-central.firebaseapp.com",
  databaseURL: "https://basquet-central-default-rtdb.firebaseio.com",
  projectId: "basquet-central",
  storageBucket: "basquet-central.appspot.com",
  messagingSenderId: "954160968950",
  appId: "1:954160968950:web:f3c95d584d2c190655a8d7",
  measurementId: "G-XGP39YQYLF"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

function Home() {
  return( 
    <div className="container">
      <div className="header-collection">
        <div className="header-logo">
          <a href="/">
            <img src={logo} width="1000" alt="" />
          </a>
        </div>
      </div>

     <div className="nav-collection">
       <div className="nav-item">
        <img src={info} width="300" alt="" />
       </div>
       <div className="nav-item">
        <Link to="/redeem"> 
          <img src={redeem} width="120" alt="" /> 
        </Link>
       </div>
      </div>
      <div className="ad">
        <div className="ad-collection">
          <Canvas />
        </div>
      </div>
    </div>
  );
}

export default Home;
